$usercombo.Add_SelectedValueChanged({
$Userlistbox.items.Clear()
    $idens = $usercombo.Selecteditem + ":\calendar"
    $global:myuser = $usercombo.Selecteditem
    $resultsofit = get-mailboxfolderpermission -identity $idens | select User, accessrights
    foreach ($res in $resultsofit){
        $thataccess = $res.accessrights
        $thoseguys = $res.User | select DisplayName
        $addthis = $thoseguys.displayname
        $Userlistbox.Items.Add($addthis)
    }
})

$Connectbutton.Add_MouseClick({ 
    $UserCredential = Get-Credential
    $global:Session = New-PSSession -ConfigurationName Microsoft.Exchange -ConnectionUri https://outlook.office365.com/powershell-liveid/ -Credential $UserCredential -Authentication Basic -AllowRedirection
    Import-PSSession $global:Session -DisableNameChecking -AllowClobber
    $Connectstatus.Text = "Connecting"
    $Connectstatus.ForeColor = "orange"
        if ($global:Session){
            $Connectstatus.Text = "Connected"
            $Connectstatus.ForeColor = "green"
            $usercombo.Enabled = $true
            $Adduserbutton.Enabled = $true
            $edituserbutton.Enabled = $true
            $removeuserbutton.Enabled = $true
            $mailboxusers = get-mailbox -identity * | select alias
            foreach ($muser in $mailboxusers){
                $usercombo.items.Add($muser.alias)
            }
        }
        else{
            $Connectstatus.text = "failed"
        }
 })

